var tipuesearch = {"pages": [{'title': 'member', 'text': '   40523252\xa0  王彥筑 40723207\xa0  吳文翔 40723210\xa0  李承澤 40723216\xa0   林子欽 40723226\xa0 \xa0 高立倫 40723232\xa0  陳鈺凱 40723236\xa0  黃宏裕 40732319\xa0  林鉦淯 \n \n 倉儲網址: https://github.com/s40723210/cad2019bg5 \n mdecourse-lssues: https://github.com/mdecourse/cad2019/issues \n', 'tags': '', 'url': 'member.html'}, {'title': 'Weeks', 'text': 'Week10~14 \n Week15~18 \n', 'tags': '', 'url': 'Weeks.html'}, {'title': 'Week10~14', 'text': '\n Fork倉儲 \n \n \n \n 1.先登入github，在搜尋自己組的倉儲，點進去。 2.點選右上角的Fork，選擇自己的github。 3. git clone --recurse-submodules \xa0(倉儲網址)。 4.git push完成，點選New pull request，等組長同意。 5.有衝突的話，進行git pull (倉儲網址)\xa0。 6.整合完成之後即可git push，等待組長同意。 我的教學影片(有字幕): https://youtu.be/1bZ16BgmF8c \n \n', 'tags': '', 'url': 'Week10~14.html'}, {'title': 'Creo開發緣起', 'text': '\n', 'tags': '', 'url': 'Creo開發緣起.html'}, {'title': 'solidworks開發緣起', 'text': '\n', 'tags': '', 'url': 'solidworks開發緣起.html'}, {'title': 'NX開發緣起', 'text': '\n', 'tags': '', 'url': 'NX開發緣起.html'}, {'title': 'inventor開發緣起', 'text': '\n', 'tags': '', 'url': 'inventor開發緣起.html'}, {'title': 'Week15~18', 'text': '\n', 'tags': '', 'url': 'Week15~18.html'}, {'title': '教科書整理', 'text': '2015- Space Modeling with SolidWorks and NX https://link.springer.com/book/10.1007/978-3-319-03862-9 \n NX 12 for Engineering Design http://mde.tw/cad2019/downloads/NX-12-for-Engineering-Design.pdf \xa0 \n', 'tags': '', 'url': '教科書整理.html'}, {'title': 'Space Modeling with SolidWorks and NX', 'text': '這本書通過一系列循序漸進的教學，使讀者了解空間在工程師的抽象世界中 的重要性以及創建產品模型的能力虛擬空間中的技能，這對需要在專業環境中， 提出特定產品的任何設計師或工程師來說，這項技能都是必不可少的。\xa0 \xa0 \xa0 \n 練習是在邏輯上從簡單到復雜的。儘管使用 SolidWorks 或是 NX 軟件，但基 本原理適用於所有繪圖軟件。在每種情況下，解釋都涵蓋了從基本概念和生產能 力到實際模型的整個過程。還清楚地說明了從 3D 模型到 2D 製造圖的轉換。\xa0 \xa0 \xa0 \n 本書的主題包括棱柱，軸對稱，對稱和復雜形狀的建模；使用建模軟件對物 理模型進行數字化；從物理模型開始創建 CAD 模型；自由曲面造型按照自下而上 和自上而下的原則對產品裝配進行建模；並按照技術文件規則展示產品。這本書 包含 500 多個圖形，是對於希望掌握空間建模技術的學生來說是理想的選擇。這 一本書是出色的教學和研究輔助工具，並且是易於使用的引導指南。\xa0', 'tags': '', 'url': 'Space Modeling with SolidWorks and NX.html'}, {'title': 'NX 12 for Engineering Design', 'text': 'NX是世界上最先進且緊密集成的CAD / CAM / CAE產品之一Siemens PLM Software提供的開發解決方案。跨越整個產品範圍通過開發，NX為各種規模的企業提供了巨大的價值。簡化複雜的產品開發，從而加快了將產品推向市場的過程。 NX軟件集成了多學科原理，概念設計，3D建模，文檔，工程分析，圖形仿真和並行工程。的該軟件通過集成基於約束的功能而具有強大的混合建模功能建模和顯式幾何建模。除了對標準幾何零件建模外，它還可以允許用戶設計複雜的自由形狀，例如機翼和歧管。它也合併實體和曲面建模技術集成到一個功能強大的工具集中。 本自指導教程為用戶提供了逐步學習NX 12的方法。對於那些以前沒有使用NX的人。 但是，以前版本的NX的用戶可能還發現本教程對他們學習新的用戶界面和功能很有用。用戶將從開始NX 12會話到創建具有各種功能的模型和設計的指導應用程序。每一章都有通過各種對話框和屏幕截圖。這些組件隨後用於裝配建模，加工和有限元素分析。組件文件也可以在線下載和使用。我們先發布了Unigraphics 18教程，隨後針對NX 2進行了更新，隨後更新了NX 3，NX 5，NX 7，NX 9和NX10。 此內容進一步更新了NX 12。我們之前準備NX自學教程的工作是由美國國家科學基金會資助的基金會的高級技術教育計劃，由基金會的合作夥伴協作工程教育（PACE）計劃的進展。 \n', 'tags': '', 'url': 'NX 12 for Engineering Design.html'}, {'title': '第二章-入門教學', 'text': '', 'tags': '', 'url': '第二章-入門教學.html'}, {'title': '第三章-二維草圖', 'text': '', 'tags': '', 'url': '第三章-二維草圖.html'}, {'title': '第四章-三維建模', 'text': '', 'tags': '', 'url': '第四章-三維建模.html'}, {'title': '第五章- 基本草圖', 'text': '', 'tags': '', 'url': '第五章- 基本草圖.html'}, {'title': '第六章- 組配建模', 'text': '', 'tags': '', 'url': '第六章- 組配建模.html'}, {'title': '第七章-自由曲面建模', 'text': '', 'tags': '', 'url': '第七章-自由曲面建模.html'}, {'title': '第八章-有限元分析', 'text': '第九章- 程式編寫與模擬\n', 'tags': '', 'url': '第八章-有限元分析.html'}, {'title': 'CAD\xa0 software', 'text': 'AutoCAD \n \n Inventor \n \n Solidworks \n \n solvespace \n \n  NX \n \n Onshape \n \n Creo (Pro/E) \n', 'tags': '', 'url': 'CAD\xa0 software.html'}, {'title': 'Notes', 'text': '\n', 'tags': '', 'url': 'Notes.html'}, {'title': 'About', 'text': '此內容管理系統以\xa0 https://github.com/mdecourse/cmsimde \xa0作為 submodule 運作, 可以選定對應的版本運作, cmsimde 可以持續改版, 不會影響之前設為 submodule, 使用舊版 cmsimde 模組的內容管理相關運作. \n 利用 cmsimde 建立靜態網誌方法: \n 1. 在 github 建立倉儲, git clone 到近端 \n 2. 參考\xa0 https://github.com/mdecourse/newcms , 加入除了 cmsimde 目錄外的所有內容 \n 以 git submodule add\xa0 https://github.com/mdecourse/cmsimde \xa0cmsimde \n 建立 cmsimde 目錄, 並從 github 取下子模組內容. \n 3.在近端維護時, 更換目錄到倉儲中的 cmsimde, 以 python wsgi.py 啟動近端網際伺服器. \n 動態內容編輯完成後, 以 generate_pages 轉為靜態內容, 以 git add commit 及 push 將內容推到遠端. \n 4. 之後若要以 git clone 取下包含 submodule 的所有內容, 執行: \n git clone --recurse-submodules  https://github.com/mdecourse/newcms.git \n', 'tags': '', 'url': 'About.html'}, {'title': 'Develop', 'text': 'https://github.com/mdecourse/cmsimde \xa0的開發, 可以在一個目錄中放入 cmsimde, 然後將 up_dir 中的內容放到與 cmsimde 目錄同位階的地方, 使用 command 進入 cmsimde 目錄, 執行 python wsgi.py, 就可以啟動, 以瀏覽器 https://localhost:9443\xa0就可以連接, 以 admin 作為管理者密碼, 就可以登入維護內容. \n cmsimde 的開發採用 Leo Editor, 開啟 cmsimde 目錄中的 cmsimde.leo 就可以進行程式修改, 結束後, 若要保留網際內容, 只要將 cmsimde 外部的內容倒回 up_dir 目錄中即可後續對 cmsimde 遠端倉儲進行改版. \n init.py 位於\xa0 up_dir 目錄, 可以設定 site_title 與 uwsgi 等變數.', 'tags': '', 'url': 'Develop.html'}]};